name: indico
onprem: True
parentDomain: .indico.io
publicDomain:
publicIP: 127.0.0.1
apiIP: <!lookup:publicIP>
disableResourceLimits: true

nvidia:
  path: /usr/bin

clusterVolumes:
  rwx:
    hostPath:
      path:
  rox:
    hostPath:
      path:

frontend:
  config:
    features:
      ocrProcessing: true

postgres:
  app:
    host: postgres
    password: aW5kaWNvZGJwdw==
    user: indico
  custom:
    autoCreateDB: "True"
    host: postgres
    password: aW5kaWNvZGJwdw==
    user: indico

redis:
  celery:
    host: celery-backend
    port: "6379"
  user:
    host: user-redis
    port: "6379"

rabbit:
  default_pass: <generate_secret>
  erlang_cookie: <generate_secret>

globalVars:
  disableCeleryTimeLimit: 'True'
  pubsubEnabled: 'False'

secrets:
  atmosphere_cookie_secret: <generate_secret>
  atmosphere_password_salt: <generate_secret>
  atmosphere_token_secret: <generate_secret>
  indico_apikey_salt: <generate_secret>
  indicoapi_api_key: <generate_secret>
  ocr_license_key: YzEwNjNiZmNiYzkxYjg4MmNkYzFjYzJjMjQzYjVlMDM=

services:
  app-edge:
    values:
      ports:
        http_api_port:
        http_port:
        https_port:
  cluster-admin:
    group: misc
    template: cluster-admin
  moonbow:
    values:
      env:
      - name: FINETUNE_ENABLED
        value: 'True'
  postgres:
    group: misc
    template: postgres
  user-redis:
    group: misc
    template: user-redis


tls:
  cert: 
  key: 
